function Card_Text() {
    return (
        <div>
            <div className="header">
                <h3>
                    Improve your front-end skills by building projects
                </h3>
            </div>
            <div className="subtext">
                <p>
                    Scan the QR code to visit Frontend Mentor and take your coding to the next level
                </p>
            </div>
        </div>
    );
};

export default Card_Text
